INSERT INTO luffycity.django_admin_log (id, action_time, object_id, object_repr, action_flag, change_message, content_type_id, user_id) VALUES (306, '2020-05-09 01:07:39.754290000', '10', '这些年来，前端行业一直在飞速发展，行业的进步，导致对从业人员的要求不断攀升。放眼未来，虽然只会某些框架还可以找到工作，但仅仅满足于会用，一定无法走的更远。随着越来越多“聪明又勤奋”的人加入前端行列，能否洞悉前沿框架的设计和实现已经成为高级人才与普通人才的“分水岭”。本课将通过探究Vue.js渲染中变化侦测的实现原理，来解读GitHub上最流行Web框架Vue.js源码背后的思想，让你亲身体验从“知', 1, '[{"added": {}}]', 9, 1);
