INSERT INTO luffycity.django_admin_log (id, action_time, object_id, object_repr, action_flag, change_message, content_type_id, user_id) VALUES (310, '2020-05-09 01:11:12.866046000', '11', 'BOSS直聘数据显示,区块链自2018年起成为行业最大风口,风头几平盖过人工智能,区块链相关岗位需求激增,平均招聘薪资达到25K。区块链因比特币而火起来的,但其更大的前景是在企业级应用,很多知名企业都在发力区块链技术的应用。例如Northern Trust私募基金通过区块链技术不断提升复杂私募基金交易的明晰度。沃尔玛与食品供应链上的其他成员紧密协作,通过区域链技术提高产品生产流程的可追踪性与透明度', 1, '[{"added": {}}]', 9, 1);
