INSERT INTO luffycity.django_admin_log (id, action_time, object_id, object_repr, action_flag, change_message, content_type_id, user_id) VALUES (321, '2020-05-09 01:16:12.442127000', '13', '随着全球网络信息技术高速发展,网络安全已成为“国之重器”。“网络安全竞争归根结底是人才的竞争”,而我国网络安全实战型人オ严重匮乏,缺口高达70万。此外,国内Web渗透测试课程缺乏系統化、体系化。作为培训界人才培养的“黄埔军校”,老男孩安全学院有着完备的教学人才培养体系,其中包括:全方位精品课程体系、雄厚的师资团队、安全厂商及企业绿色通道等,助力学员在全面、深入的掌握网络安全知识技能、实现安全专业能', 1, '[{"added": {}}]', 9, 1);
